const input_layer_nodes_qty = 625
const hidden_layers_qty = 2
const hidden_layers_nodes = [20, 20]
const output_layer_nodes_qty = 10

const sigmoid = x => 1 / (1 + Math.exp(-x))

function predict(input) {
	const inputResults = []

	const nodes = hidden_layers_qty ? hidden_layers_nodes[0] : output_layer_nodes_qty
	for (let i = 0; i < nodes; i++) {
	 	let sum = 0
	 	for (let j = 0; j < input_layer_nodes_qty; j++) {
		 	sum += input[j] * weights.input_layer[j][i]
	 	}
	 	sum += weights.biases.bias0[i]
	 	inputResults.push(sigmoid(sum))
	}

 	const hidden_results = [inputResults]
	let currentResult = [...inputResults]

	if (hidden_layers_qty > 1) {
		for (let layer = 1; layer < hidden_layers_qty; layer++) {
		 	let nextResult = []
		 	for (let i = 0; i < hidden_layers_nodes[layer]; i++) {
			 	let sum = 0;
			 	for (let j = 0; j < currentResult.length; j++) {
					sum += currentResult[j] * weights.hidden_layers['layer'+(layer-1)][j][i]
			 	}	
			 	sum += weights.biases['bias'+layer][i]
			 	nextResult.push(sigmoid(sum));
		 	}
		 	currentResult = [...nextResult]
		 	hidden_results.push(nextResult)
	 	}
	}

 	const preOutput = [...currentResult]

 	const output = [];

 	for (let i = 0; i < output_layer_nodes_qty; i++) {
	 	let sum = 0;
	 	for (let j = 0; j < preOutput.length; j++) {
		 	sum += preOutput[j] * weights.hidden_layers['layer'+(hidden_layers_qty-1)][j][i]
	 	}
	 	sum += weights.biases.bias_last[i]
	 	output.push(sigmoid(sum));
 	}

 	return output
}

const first = document.getElementById('first')
const second = document.getElementById('second')
const third = document.getElementById('third')

let input = []

setInterval(() => {
	input = []
	for (let div of divs) {  
		input.push(div.className === 'active' ? 1 : 0)
	} 

	const prediction = predict(input)
	const sortedPrediction = prediction.toSorted((a, b) => b - a)

	const numbers = [prediction.indexOf(sortedPrediction[0]), prediction.indexOf(sortedPrediction[1]), prediction.indexOf(sortedPrediction[2])]
	
	first.textContent = numbers[0]
	second.textContent = numbers[1]
	third.textContent = numbers[2]
}, 50)